import React from 'react';
import { Form } from 'react-bootstrap';

const Footer = () => {
    return (
        
          <div className="row d-flex">
            <div className="col-md-6 col-sm-12">

            </div>
            <div className="col-sm-12 col-md-6">
            <Form.Control
    type="password"
    id="inputPassword5"
    aria-describedby="passwordHelpBlock"
  />
            </div>
          </div>

            
          
    );
};

export default Footer;
